/* Procedure structure for procedure `epds_GenerateSTANRRN` */

/*!50003 DROP PROCEDURE IF EXISTS  `epds_GenerateSTANRRN` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `epds_GenerateSTANRRN`(IN IN_TransactionID VARCHAR(12))
BEGIN
	DECLARE v_jullianday VARCHAR(5);
	DECLARE v_hour VARCHAR(3);
	DECLARE v_minute VARCHAR(3);
	DECLARE v_year VARCHAR(4);
	DECLARE v_stan VARCHAR(30);

	SELECT CONCAT ('00' , DAYOFYEAR(NOW())) INTO v_jullianday;
	SELECT CONCAT ('0', HOUR(NOW())) INTO v_hour;
	SELECT CONCAT ('0', MINUTE(NOW())) INTO v_minute;
	SELECT YEAR(NOW()) INTO v_year;

	SELECT CONCAT('000000', LAST_INSERT_ID()) INTO v_stan;

	SELECT CONCAT(SUBSTRING(v_year,4,1), SUBSTRING(v_jullianday,-3), SUBSTRING(v_hour, -2), 
	SUBSTRING(v_stan,-6)) AS v_rrn, SUBSTRING(v_stan, -6) AS v_stan;
END */$$
DELIMITER ;

