/* Procedure structure for procedure `epds_InsertTxnSummary` */

/*!50003 DROP PROCEDURE IF EXISTS  `epds_InsertTxnSummary` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `epds_InsertTxnSummary`(
    IN p_MTI VARCHAR(4),
    IN p_transactionID VARCHAR(12),
    IN p_RRN VARCHAR(12),
    IN p_GatewayRRN VARCHAR(12),
    IN p_GatewaySTAN  VARCHAR(6),
    IN p_CustAadhaarNo VARCHAR(12),
    IN p_CustAccountNo VARCHAR(20),
    IN p_Amount VARCHAR(13),
    IN p_PostedTime TIMESTAMP(3),
    IN p_TransactionTime TIMESTAMP(3),
    IN p_GatewayResponseCode VARCHAR(3),
    IN p_IIN VARCHAR(6),
    IN p_PRRN VARCHAR(36),
    IN p_DeviceID VARCHAR(60),
    IN p_ResponseString VARCHAR(512),
    IN p_ClientIP VARCHAR(24),
    IN p_ClientPORT VARCHAR(6),
    IN p_GatewayConnectionTime TIMESTAMP(3),
    IN p_GatewaySendTime TIMESTAMP(3),
    IN p_GatewayRespBackTime TIMESTAMP(3),
    IN p_MerchanID VARCHAR(16),
    IN p_BatchID VARCHAR(16),
    IN p_Platform VARCHAR(15),
    IN p_RespToClient VARCHAR(3),
    IN p_CBSTerminalID VARCHAR(15),
    IN p_VendorID VARCHAR(3),
    IN p_UUID VARCHAR(60),
    IN p_STAN VARCHAR(6),
    IN p_ServiceName VARCHAR(15),
    IN p_ServerTime TIMESTAMP(3),
    IN p_TxnRemarks VARCHAR(512),
    IN p_Latitude VARCHAR(15),
    IN p_Longitude VARCHAR(15))
BEGIN
    `CustAccountNumber`,`Amount`, `PostedTime`, `TransactionTime`, `GatewayResponseCode`,`IIN`, `PRRN`,`DeviceID`, `ResponseString`,
    `ClientIP`, `ClientPORT`, `GatewayConnectionTime`, `GatewaySendTime`, `GatewayRespBackTime`, `MerchantID`, `BatchID`,`Platform`, `RespToClient`
    ,`CBSTerminalID`, `VendorID`, `UUID`, `STAN`, `ServerTime`,`ServiceName`, `TxnRemarks`, `Latitude`, `Longitude`)
    VALUES (p_MTI, p_transactionID, p_RRN, p_GatewayRRN,p_GatewaySTAN, p_CustAadhaarNo,
    p_CustAccountNo, p_Amount, p_PostedTime, p_TransactionTime, p_GatewayResponseCode, p_IIN, p_PRRN, p_DeviceID, p_ResponseString,
    p_ClientIP,  p_ClientPORT,  p_GatewayConnectionTime,  p_GatewaySendTime , p_GatewayRespBackTime,  p_MerchanID,  p_BatchID,
    p_Platform, p_RespToClient, p_CBSTerminalID, p_VendorID, p_UUID, p_STAN, p_ServerTime, p_ServiceName, 
    p_TxnRemarks, p_Latitude, p_Longitude);
