/* Procedure structure for procedure `mer_addDeviceInfo` */

/*!50003 DROP PROCEDURE IF EXISTS  `mer_addDeviceInfo` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mer_addDeviceInfo`( param_corporateId VARCHAR(10), param_outletCode VARCHAR(14),param_devicecode VARCHAR(16),param_deviceType BIGINT(20),param_deviceSerialNo VARCHAR(50))
BEGIN
	DECLARE merchant_id BIGINT(20);
	DECLARE outlet_id BIGINT(20);
	DECLARE outlet_code VARCHAR(14);
	DECLARE outlet_id_match BIGINT(20);
	DECLARE merchant_hierarchy_id BIGINT(20);
	DECLARE device_id BIGINT(20);
	DECLARE response VARCHAR(200);
	DECLARE merchant_type VARCHAR(10);
	DECLARE user_id BIGINT(20);
	DECLARE isSuccessful BOOLEAN;
SET isSuccessful = FALSE ;
SET autocommit = 0;	
SET merchant_id = '';
SET outlet_code = '' ;
SET outlet_id_match = '' ;
SAVEPOINT V1;
IF ( param_corporateId = '' ) THEN
	SET response = "CorporateId is missing";
	
ELSEIF ( param_outletCode = '' ) THEN
	SET response = "OutletId is missing";
	
ELSEIF ( param_devicecode = '' ) THEN
	SET response = "Device IMEI number is missing";
	
ELSEIF ( LENGTH(param_devicecode) != 16 ) THEN
	SET response = "IMEI is invalid. IMEI number should be 16 digit";
	
ELSEIF ( param_deviceType = '' ) THEN
	SET response = "FP device type is missing";
	
ELSEIF ( param_deviceSerialNo = '' ) THEN
	SET response = "FP device serial number is missing";
	
ELSE
SELECT `merchantid`,`merchanttype`,`merchantheirarchyid` INTO merchant_id,merchant_type,merchant_hierarchy_id FROM `mer_merchantmaster` WHERE `merchantcode` = param_corporateId;
SELECT `userid` INTO user_id FROM `adm_usermaster` WHERE `hierarchyid` = merchant_hierarchy_id;
SELECT `outletcode`,outletid INTO outlet_code,outlet_id FROM `mer_outletmaster` WHERE `outletcode` = param_outletCode;
SELECT `outletid` INTO outlet_id_match FROM `mer_outletmaster` WHERE `merchantid` = merchant_id AND `outletcode` = param_outletCode;
IF ( merchant_id = '' ) THEN
	SET response = "Given CorporateId is not available";
	
ELSEIF ( outlet_code = '' ) THEN 
	SET response = "Given OutletId is not available";
	
ELSEIF ( outlet_id_match = '') THEN
	SET response = "Given CorporateId  is not matched with the given OutletId";	
	
ELSE	
	-- Insert Device Details -- 
	IF ( merchant_type = 'Individual' ) THEN
		SELECT param_devicecode,'Active',param_deviceType,param_deviceSerialNo,user_id;
		SELECT LAST_INSERT_ID() INTO device_id;	
	ELSE
		SELECT param_devicecode,'Active',param_deviceType,param_deviceSerialNo,param_remarks;
		SELECT LAST_INSERT_ID() INTO device_id;	
	END IF;
		
	-- Insert Outlet & Device Mapping Details --
	SELECT outlet_id,device_id;
	
	SET response = "Device Uploaded Successfully";	
	SET isSuccessful = TRUE ;
	SET autocommit = 1;
END IF;
END IF;
IF ( isSuccessful ) THEN
SELECT response,`devicecode`,`devicestatus`,`fpdevicetype`,`fpdeviceserialno`,`remarks` FROM `mer_devicemaster` WHERE `deviceid` = device_id;
ELSE
SELECT response FROM DUAL;
END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `mer_addOutletInfo` */

/*!50003 DROP PROCEDURE IF EXISTS  `mer_addOutletInfo` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mer_addOutletInfo`( param_corporateId VARCHAR(10), param_outletCode VARCHAR(14),param_outletName VARCHAR(200),param_address VARCHAR(200),param_pincode VARCHAR(10), param_city VARCHAR(100),param_state BIGINT(20),param_district BIGINT(20),param_mobile VARCHAR(15),param_accNumber VARCHAR(20),param_cbsTerminalId VARCHAR(8),param_createdBy VARCHAR(100))
BEGIN
	DECLARE dup_outletCode VARCHAR(14);
	DECLARE creation_date DATETIME ;
	DECLARE merchant_id BIGINT(20);
	DECLARE outlet_hierarchy_id BIGINT(20);
	DECLARE merchant_hierarchy_id BIGINT(20);
	DECLARE merchant_hierarchy_string VARCHAR(200);
	DECLARE level_id BIGINT(20);
	DECLARE response VARCHAR(500);
	DECLARE outlet_id BIGINT(20);
	DECLARE isSuccessful BOOLEAN;
SET isSuccessful = FALSE ;
SET autocommit = 0;	
SET creation_date=NOW();
SET dup_outletCode = '';
SET merchant_id = '' ;
SAVEPOINT V1;
IF ( param_corporateId = '' ) THEN
	SET response = "CorporateId is missing";
	
ELSEIF ( param_outletCode = '' ) THEN
	SET response = "OutletId is missing";
	
ELSEIF ( param_outletName = '' ) THEN
	SET response = "OutletName is missing";
	 
ELSEIF ( param_address = '' ) THEN
	SET response = "Address is missing";
	
ELSEIF ( param_pincode = '' ) THEN
	SET response = "Pincode is missing";
	
ELSEIF ( param_city = '' ) THEN
	SET response = "City is missing";
	
ELSEIF ( param_state = '' ) THEN
	SET response = "State is missing";
	
ELSEIF ( param_district = '' ) THEN
	SET response = "District is missing";
	
ELSEIF ( param_mobile = '' ) THEN
	SET response = "Mobile number is missing";
	
ELSEIF ( param_accNumber = '' ) THEN
	SET response = "Account number is missing";
	
ELSEIF ( param_cbsTerminalId = '' ) THEN
	SET response = "CBSTerminalId is missing";
	
ELSE
SELECT `outletcode` INTO dup_outletCode FROM `mer_outletmaster` WHERE `outletcode` = param_outletCode;
SELECT `merchantid` INTO merchant_id FROM `mer_merchantmaster` WHERE `merchantcode` = param_corporateId;
SELECT `hierarchyid`,`hierarchystring` INTO merchant_hierarchy_id , merchant_hierarchy_string FROM `adm_hierarchymaster` WHERE `hierarchycode` = param_corporateId;
	
SELECT `levelid` INTO level_id FROM `adm_levelmaster` WHERE `leveltype` = 'OUTLET';
IF ( merchant_id = '' ) THEN
	SET response = "Given CorporateId is not available";
	SET isSuccessful = FALSE;
	
ELSEIF ( dup_outletCode != '' ) THEN
	SET response = "Given OutletId is already assigned to another outlet";
	SET isSuccessful = FALSE;
	
ELSE	
	
	-- Insert Outlet Hierarchy Details --
	SELECT param_outletCode,param_outletName,merchant_hierarchy_id,level_id,CONCAT(merchant_hierarchy_string,param_outletCode,"/");
	
	SELECT LAST_INSERT_ID() INTO outlet_hierarchy_id;
	
	-- Insert Outlet Registration Details --
	
	SELECT param_outletCode,param_outletName,param_mobile,param_accNumber,param_address,param_city,param_pincode,param_state,param_district,'Active',merchant_id,param_cbsTerminalId,creation_date,param_createdBy,outlet_hierarchy_id;
	
	SELECT LAST_INSERT_ID() INTO outlet_id;
	
	IF ( outlet_id != '' ) THEN 
		
		SET response = "Outlet Details Uploaded Successfully";	
		SET autocommit = 1;
		SET isSuccessful = TRUE;
	
	ELSE
		SET response = "Outlet upload fails";	
	END IF;	
END IF;
IF(isSuccessful) THEN
	SELECT response ,`outletcode`,`name`,`mobile`,`accountnumber`,`address`,`city`,`pincode`,`state`,`district`,`status`,`remarks`,`cbsterminalid` FROM `mer_outletmaster`
	WHERE outletid = outlet_id;
ELSE 
   SELECT response FROM DUAL;
END IF;
END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `mer_getMerchantsDashBoardInfo` */

/*!50003 DROP PROCEDURE IF EXISTS  `mer_getMerchantsDashBoardInfo` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mer_getMerchantsDashBoardInfo`()
begin
	DECLARE  registered_merchants bigint(20);
	DECLARE  merchants_pending_for_approval BIGINT(20);
	DECLARE  approved_merchants BIGINT(20);
	DECLARE  rejected_merchants BIGINT(20);
	
select count(`merchantid`) into registered_merchants from `mer_merchantmaster` ;
select count(`merchantid`) into merchants_pending_for_approval from `mer_merchantmaster` WHERE `status` IN (1,2) ;
SELECT COUNT(`merchantid`) INTO approved_merchants FROM `mer_merchantmaster` WHERE `status` = 3 ;
SELECT COUNT(`merchantid`) INTO rejected_merchants FROM `mer_merchantmaster` WHERE `status` = 4 ;
select registered_merchants,merchants_pending_for_approval,approved_merchants,rejected_merchants;
END */$$
DELIMITER ;

