/*!50003 CREATE PROCEDURE `mer_modifyDeviceInfo`(param_outletCode VARCHAR(14),param_devicecode VARCHAR(16),param_deviceType BIGINT(20),param_deviceSerialNo VARCHAR(50),param_deviceStatus VARCHAR(50),param_remarks VARCHAR(200))
BEGIN
	DECLARE outlet_code VARCHAR(14);
	DECLARE outlet_id_match BIGINT(20);
	DECLARE device_id BIGINT(20);
	DECLARE device_code VARCHAR(16);
	DECLARE fp_device_type BIGINT(20);
	DECLARE fp_device_serial_no VARCHAR(50);
	DECLARE response VARCHAR(200);
	DECLARE loaded_device_status VARCHAR(14);
	DECLARE isSuccessful BOOLEAN;
SET isSuccessful = FALSE ;
SET autocommit = 0;	
SET outlet_code = '' ;
SET outlet_id_match = '' ;
SET device_id = '' ;
SET device_code = '' ;
SET fp_device_type = '' ;
SET fp_device_serial_no = '' ;
SAVEPOINT V1;
IF ( param_outletCode = '' ) THEN
	SET response = "OutletId is missing";
	
ELSEIF ( param_devicecode = '' ) THEN
	SET response = "Device IMEI number is missing";	
	
ELSEIF ( param_deviceType = '' ) THEN
	SET response = "FP device type is missing";
	
ELSEIF ( param_deviceSerialNo = '' ) THEN
	SET response = "FP device serial number is missing";
	
ELSEIF ( param_deviceStatus = '' ) THEN
	SET response = "IMEI is invalid. IMEI number should be 16 digit";	
	
ELSE 
SELECT `outletcode` INTO outlet_code FROM `mer_outletmaster` WHERE `outletcode` = param_outletCode;
SELECT `outletid` INTO outlet_id_match FROM `mer_outletmaster` WHERE `outletcode` = param_outletCode;
SELECT `devicecode`,`fpdevicetype`,`fpdeviceserialno`,devicestatus INTO device_code,fp_device_type, fp_device_serial_no,loaded_device_status FROM `mer_devicemaster` WHERE `devicecode` = param_devicecode ;
IF ( outlet_code = '' ) THEN 
	SET response = "Given OutletId is not available";
	
ELSEIF ( outlet_id_match = '') THEN
	SET response = "Given CorporateId  is not matched with the given OutletId";	
	
ELSEIF ( device_code = '' ) THEN 
SET response = "Given IMEI number is not available";	
	
ELSE		
	
	-- Update Device Details -- 
	UPDATE `mer_devicemaster` 
	SET `devicestatus` = param_deviceStatus,remarks = param_remarks,`devicecode` = param_devicecode,
	`fpdevicetype` = param_deviceType,	`fpdeviceserialno` = param_deviceSerialNo
	WHERE `devicecode` = param_devicecode;
	
	SELECT deviceid INTO device_id FROM mer_devicemaster WHERE `devicestatus` = param_deviceStatus AND `devicecode` = param_devicecode AND `fpdevicetype` = param_deviceType AND `fpdeviceserialno` = param_deviceSerialNo ;
	
	IF (device_id != '' ) THEN
	
		-- Block Device --
		IF ( loaded_device_status = 'Active' AND param_deviceStatus = 'Block' ) THEN
			
			SET response = "Device Blocked Successfully";	
			
		-- Update Device --
		ELSEIF ( loaded_device_status = 'Active' AND param_deviceStatus = 'Active' ) THEN		
			
			SET response = "Device Updated Successfully";
			
		-- Reactivate Device --
		ELSEIF ( loaded_device_status = 'Block' AND param_deviceStatus = 'Active' ) THEN		
			
			SET response = "Device Reactivated Successfully";
		END IF;
		
		SET autocommit = 1;
		
	ELSE
	
		SET response = "Device Update Failed";	
		
	END IF;
END IF;
END IF;
SELECT response ,`devicecode`,`devicestatus`,`fpdevicetype`,`fpdeviceserialno`,`remarks` FROM `mer_devicemaster` WHERE deviceid = device_id ;
END */$$
DELIMITER ;

