/* Procedure structure for procedure `mer_modifyOutletInfo` */

/*!50003 DROP PROCEDURE IF EXISTS  `mer_modifyOutletInfo` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mer_modifyOutletInfo`( param_corporateId VARCHAR(10), param_outletCode VARCHAR(14),param_outletName VARCHAR(200),param_address VARCHAR(200),param_pincode VARCHAR(10), param_city VARCHAR(100),param_state BIGINT(20),param_district BIGINT(20),param_mobile VARCHAR(10),param_accNumber VARCHAR(20),param_cbsTerminalId VARCHAR(8),param_status VARCHAR(10),param_remarks VARCHAR(200))
BEGIN
	DECLARE outlet_code VARCHAR(14);
	DECLARE merchant_id BIGINT(20);
	DECLARE merchant_hierarchy_id BIGINT(20);
	DECLARE merchant_hierarchy_string VARCHAR(200);
	DECLARE outlet_id BIGINT(20);
	DECLARE outlet_id_match BIGINT(20);
	DECLARE  response VARCHAR(200);
SET autocommit = 0;	
SET merchant_id = '';
SET outlet_code = '' ;
SET outlet_id_match = '' ;
SET outlet_id = '' ;
SAVEPOINT V1;
IF ( param_corporateId = '' ) THEN
	SET response = "CorporateId is missing";
	
ELSEIF ( param_outletCode = '' ) THEN
	SET response = "OutletId is missing";
	
ELSEIF ( param_outletName = '' ) THEN
	SET response = "OutletName is missing";
	
ELSEIF ( param_address = '' ) THEN
	SET response = "Address is missing";
	
ELSEIF ( param_pincode = '' ) THEN
	SET response = "Pincode is missing";
	
ELSEIF ( param_city = '' ) THEN
	SET response = "City is missing";
	
ELSEIF ( param_state = '' ) THEN
	SET response = "State is missing";
	
ELSEIF ( param_district = '' ) THEN
	SET response = "District is missing";
	
ELSEIF ( param_mobile = '' ) THEN
	SET response = "Mobile number is missing";
	
ELSEIF ( param_accNumber = '' ) THEN
	SET response = "Account number is missing";
	
ELSEIF ( param_cbsTerminalId = '' ) THEN
	SET response = "CBSTerminalId is missing";
	
ELSE
SELECT `merchantid` INTO merchant_id FROM `mer_merchantmaster` WHERE `merchantcode` = param_corporateId;
	
SELECT `hierarchyid`,`hierarchystring` INTO merchant_hierarchy_id , merchant_hierarchy_string FROM `adm_hierarchymaster` WHERE `hierarchycode` = param_corporateId;
SELECT outletcode INTO outlet_code FROM  mer_outletmaster WHERE  outletcode = param_outletCode;
SELECT `outletid` INTO outlet_id_match FROM `mer_outletmaster` WHERE `merchantid` = merchant_id AND `outletcode` = param_outletCode;
	
IF ( merchant_id = '' ) THEN
	SET response = "Given CorporateId is not available";
	
ELSEIF ( outlet_code = '' ) THEN 
	SET response = "Given OutletId is not available";
	
ELSEIF ( outlet_id_match = '') THEN
	SET response = "Given CorporateId  is not matched with the given OutletId";
	
ELSE		
	
	-- Update Outlet Details--
	UPDATE `mer_outletmaster`
	SET `name` = param_outletName,
		`mobile` =  param_mobile,
		`accountnumber`= param_accNumber,
		`address`= param_address,
		`city`= param_city,
		`pincode`= param_pincode,
		`state`= param_state,
		`district`= param_district,
		`status`= param_status,
		cbsterminalid = param_cbsTerminalId,
		`remarks` = param_remarks
		WHERE `outletcode` = param_outletCode;
	SELECT `outletid` INTO outlet_id FROM `mer_outletmaster`  WHERE `name` = param_outletName AND `mobile` =  param_mobile AND `accountnumber`= param_accNumber AND `address`= param_address AND `city`= param_city AND `pincode`= param_pincode  AND `state`= param_state AND `district`= param_district AND `status`= param_status AND cbsterminalid = param_cbsTerminalId AND `outletcode` = param_outletCode;
	 
	IF ( outlet_id != '' ) THEN
	
		-- Block outlet & device --
		IF ( param_status = 'Blocked' ) THEN						
			
			UPDATE `mer_devicemaster`
			INNER JOIN  `mer_outletdevicedetails` 
			ON  mer_outletdevicedetails.deviceid =  mer_devicemaster.`deviceid`
			INNER JOIN `mer_outletmaster` 
			ON  mer_outletmaster.`outletid` = mer_outletdevicedetails.`outletid`
			SET mer_devicemaster.`devicestatus` = 'Blocked' 
			WHERE 
			mer_devicemaster.`deviceid` = mer_outletdevicedetails.`deviceid` AND 
			mer_outletmaster.`merchantid` = merchant_id;
			
			SET response = "Outlet along with devices are blocked suxccessfully";	
		ELSEIF ( param_status = 'Active' ) THEN
		
			SET response = "Outlet Details Updated Successfully";	
		
		END IF;				
		
		SET autocommit = 1;
	
	ELSE
	
		SET response = "Outlet Update Failed";
		
	END IF;
END IF;
SELECT response FROM DUAL;
END IF;
END */$$
DELIMITER ;

