/* Procedure structure for procedure `mtxn_DeviceImformation` */

/*!50003 DROP PROCEDURE IF EXISTS  `mtxn_DeviceImformation` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mtxn_DeviceImformation`(IN p_DeviceID VARCHAR(60))
BEGIN
 
DECLARE v_Merchantcode, v_outletcode VARCHAR(15);
DECLARE v_name, v_outletname VARCHAR(45);
DECLARE v_aadhaarnumber VARCHAR(12);
DECLARE v_city, v_outletcity VARCHAR(25);
DECLARE v_address, v_outletaddress VARCHAR(250);
DECLARE v_status, v_devicestatus, v_outletstatus varchar(1);
DECLARE v_merchanttype VARCHAR(45);
DECLARE v_statecode VARCHAR(7);
DECLARE v_cbsterminalid VARCHAR(12);
DECLARE v_accountnumber VARCHAR(20);
DECLARE v_username VARCHAR(50);
DECLARE v_authtype VARCHAR(2);

DECLARE v_deviceid, v_stateid BIGINT;
DECLARE v_outletid, v_merchantid BIGINT;
DECLARE v_hierarchyid BIGINT(20);
DECLARE v_locvhcode VARCHAR(10);
DECLARE v_locbhcode VARCHAR(10);
 
	-- get deviceid from age_devicemaster 
	SELECT deviceid, devicestatus INTO v_deviceid,  v_devicestatus FROM mer_devicemaster WHERE `devicecode`=TRIM(p_DeviceID);

	IF(v_deviceid !=0) THEN 
		-- get outletid from age_agentdevicedtl
		SELECT outletid INTO v_outletid FROM mer_outletdevicedetails WHERE deviceid=v_deviceid;

		IF(v_outletid !=0) THEN 
			/* Get the hierarchy details */
			SELECT `outlethierarchyid`, `merchantid` INTO v_hierarchyid, v_merchantid FROM `mer_outletmaster` WHERE `outletid` = v_outletid;
			IF(v_hierarchyid!=0) THEN 
				/* Vendor ID, Branch code */
				SELECT GROUP_CONCAT(IF(D.hname = 'VENDOR',REPLACE(SUBSTRING_INDEX(D.hierarchystring,'/', 2),'/', ''),'') SEPARATOR ''), 
				GROUP_CONCAT(IF(D.hname = 'BRANCH',D.hierarchycode,'') SEPARATOR '') INTO v_locvhcode,v_locbhcode FROM
				(SELECT B.hierarchycode,B.hierarchystring, (CASE WHEN B.levelid = (SELECT levelid FROM adm_levelmaster WHERE levelcode = 'BRANCH') 
				THEN 'BRANCH' ELSE 'VENDOR' END) hname FROM adm_hierarchymaster B 
				INNER JOIN 
				(SELECT A.hierarchyid, '' AS hType FROM adm_userhierarchydtl A WHERE 
				A.`userid` = (SELECT merchantuserid FROM `mer_merchantmaster` A WHERE A.`merchantid` = v_merchantid)) C
				ON B.hierarchyid = C.hierarchyid) D;

				SELECT ag.`merchantcode`, ag.`name`, ag.`aadhaarnumber`, ag.`city`, ag.`state`, ag.`address`, ag.`status`, ag.`merchanttype`, au.`username`, au.`authtype`
				INTO v_merchantcode, v_name, v_aadhaarnumber, v_city, v_stateid, v_address, v_status,  v_merchanttype, v_username, v_authtype
				FROM `mer_merchantmaster` ag INNER JOIN `adm_usermaster` au ON au.`userid` = ag.`merchantuserid` WHERE ag.`merchantid`= v_merchantid;

				SELECT`charstatecode` INTO v_statecode FROM `mer_stateinfomaster` WHERE `stateid` = v_stateid;
				
				SELECT `outletcode`, `name`, `city`, `cbsterminalid`, `accountnumber`, `address`, `status`
				INTO v_outletcode, v_outletname, v_outletcity, v_cbsterminalid, v_accountnumber, v_outletaddress, v_outletstatus FROM `mer_outletmaster` WHERE  `outletid` = v_outletid;
				/* Result */
				SELECT v_merchantcode, v_name, v_aadhaarnumber, v_city, v_statecode, v_address, v_status,  v_merchanttype,  
				v_outletcode, v_outletname, v_outletcity, v_statecode AS v_outletstatecode, v_outletaddress,  v_outletstatus, v_devicestatus,
				v_cbsterminalid, v_accountnumber, v_locbhcode, v_outletcity AS v_terminallocation, v_username, v_authtype;
			ELSE
				SELECT JSON_OBJECT("errorCode","DB117","errString","Location/v_hierarchyid details not found" ) AS error;
			END IF; -- End of hierarchyid
		ELSE
			SELECT JSON_OBJECT("errorCode","DB114,","errString","Device not mapped with merchant") AS error;
		END IF; -- End of outlet
	ELSE
		SELECT JSON_OBJECT("errorCode" , "DB108" , "errString" ,"Device not found in Database") AS error;
	END IF; -- End of deviceid
 
 END */$$
DELIMITER ;

/* Procedure structure for procedure `mtxn_DeviceUpdate` */

/*!50003 DROP PROCEDURE IF EXISTS  `mtxn_DeviceUpdate` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mtxn_DeviceUpdate`(
	IN p_IMEINumber VARCHAR(60),
	IN p_MerchantAccountNo VARCHAR(20),
	IN p_Action VARCHAR(20),
	IN p_Job varchar(20),
	IN p_FPDeviceType VARCHAR(50),
	IN p_FPDeviceNo VARCHAR(50))
BEGIN
DECLARE v_outletid VARCHAR(30);
DECLARE v_merchantcode, v_outletcode VARCHAR(15);
DECLARE v_name VARCHAR(45);
DECLARE v_aadhaarnumber VARCHAR(12);
DECLARE v_city VARCHAR(25);
DECLARE v_statecode VARCHAR(7);
DECLARE v_address VARCHAR(250);
DECLARE v_status TINYINT;
DECLARE v_merchanttype VARCHAR(45);
DECLARE v_cbsterminalid VARCHAR(20);
DECLARE v_outletstatus, v_devicetype, v_deviceid, v_stateid, v_merchantid TINYINT;

	IF (P_ACTION='BYAADHAAR') THEN -- Based on Aadhar Number
		SELECT `outletid`, `outletcode`, `merchantid`, `status` INTO v_outletid, v_outletcode, v_merchantid, v_outletstatus
		FROM `mer_outletmaster` WHERE `accountnumber` iN (select `accountnumber`  from `mer_merchantmaster` where `aadhaarnumber`=p_MerchantAccountNo);
	ELSEif (P_ACTION='BYACCOUNT') THEN -- Based on Account Number
		SELECT `outletid`, `outletcode`, `merchantid`, `status` INTO v_outletid, v_outletcode, v_merchantid, v_outletstatus
		FROM `mer_outletmaster` WHERE `accountnumber`=p_MerchantAccountNo;
	END IF;
	
	IF (p_Job='EXTRACT') THEN -- Extract device details
		SELECT `merchantcode`,`name`, `aadhaarnumber`, `city`, `state`, `address`, `status`, `cbsterminalid`, `merchanttype` 
		INTO v_merchantcode, v_name, v_aadhaarnumber, v_city, v_stateid, v_address, v_status, v_cbsterminalid, v_merchanttype 
		FROM `mer_merchantmaster` WHERE `merchantid`= v_merchantid;
		SELECT`statecode` INTO v_statecode FROM `mer_stateinfomaster` WHERE `stateid` = v_stateid;
	
		SELECT v_outletcode, v_merchantcode, v_name, v_aadhaarnumber, v_city, v_statecode, v_address, v_status, v_cbsterminalid, v_merchanttype, v_outletstatus;
	ELSEif (p_Job = 'UPDATE') THEN -- Insert the new device
		SELECT `devicetypeid` INTO v_devicetype FROM `mer_devicetypemaster` WHERE `devicetype` = p_FPDeviceType;
		IF (v_devicetype = 0) THEN
			SET v_devicetype = 2;
		END IF;
		VALUES(p_IMEINumber, v_devicetype, p_FPDeviceNo, 3);
		SELECT LAST_INSERT_ID() INTO v_deviceid;
	ELSE
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'INVALID ACTION PARAMETER PASSED TO STORED PROCEDURE';
	END IF;
END */$$
DELIMITER ;

