/* Procedure structure for procedure `mtxn_GenerateBatchID` */

/*!50003 DROP PROCEDURE IF EXISTS  `mtxn_GenerateBatchID` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mtxn_GenerateBatchID`(
IN p_DeviceID VARCHAR(60),
IN p_OutletID VARCHAR(15),
IN p_ClientAppType VARCHAR(60),
IN p_MerchantID VARCHAR(15),
IN p_VendorID VARCHAR(4))
BEGIN
DECLARE v_batchid VARCHAR(10);

	VALUES(p_DeviceID, p_OutletID, p_ClientAppType,p_MerchantID, p_VendorID);
	SELECT LAST_INSERT_ID() INTO v_batchid;
	SELECT CONCAT(REPEAT('0', 7 -LENGTH(v_batchid)), v_batchid ) INTO v_batchid;
	SELECT v_batchid;
 
END */$$
