/*!50003 CREATE PROCEDURE `mtxn_getQRdetails`(in param_merchantId varchar(12))
BEGIN
     
     declare _Payload_format varchar(3);
     declare _Visaid varchar(30);
     declare _Masterid varchar(30);
     declare _Rupayid varchar(30);
     declare _Global_uid varchar(30);
     declare Pay_nw_specific varchar(50);
