     declare termid varchar(15);
     
     select `businessname`, `city`, `pincode`, `othercategory`, `cbsterminalid` into mer_name, mer_city, mer_pincode, mcc,  termid from `mer_merchantmaster` where `merchantcode` = param_merchantId; 
     select `visaid`, `masterid`, `rupayid`, `global_uid`, `payment_nw_specific`, `payload_format` into _Visaid, _Masterid, _Rupayid, _Global_uid, Pay_nw_specific, _Payload_format from `mtxn_mer_QRdetails` where `merchantcode` = param_merchantId;
     
    select mer_name as v_MERCHANT_NAME, mer_city as v_MERCHANT_CITY, mer_pincode as v_MERCHANT_PINCODE, mcc as v_MCC,  "IN" As v_COUNTRY_CODE, "356" as v_CURRENCY_CODE, termid as v_MERCHANT_TERMID,  _Visaid as v_VISAID, _Masterid as v_MASTERID, _Rupayid AS v_RUPAYID, _Global_uid as v_GLOBAL_UID, Pay_nw_specific as v_PAY_NETWORK_SPECIFIC, _Payload_format as v_PAYLOAD; 
    END */$$
