/*!50003 CREATE PROCEDURE `mtxn_GetTxnInfo`(IN DeviceId VARCHAR(20), IN FROM_DATE VARCHAR(12), IN TO_DATE VARCHAR(12))
BEGIN
    DECLARE RRN VARCHAR(12);
	SELECT  DATE(TransactionTime) AS TransactionDate, TIME(TransactionTime) AS TransactionTime, TransactionID AS TransactionID, GatewayRRN AS RRN, Amount AS Amount, RespToClient AS RespToClient, ServiceName AS Service  FROM `mtxn_txnsummary` WHERE  DATE(TransactionTime) BETWEEN FROM_DATE AND TO_DATE AND DeviceID = DeviceId;
 END */$$
