/*!50003 CREATE PROCEDURE `mtxn_GetTxnReports`(IN _outletID VARCHAR(10), IN _fromDate VARCHAR(10), _toDate VARCHAR(10) , _numberOfRecords INT(4))
BEGIN
	SELECT DATE_FORMAT(TransactionTime, '%m/%d/%Y') AS TransactionDate, TIME(TransactionTime) AS TransactionTime, TransactionID AS TransactionID, GatewayRRN AS RRN, Amount AS Amount, RespToClient AS RespToClient, ServiceName AS Service 
	FROM `mtxn_txnsummary` WHERE `OutletID`=_outletID AND TransactionTime BETWEEN CONCAT(LEAST(_fromDate, _toDate), " 00:00:00")
AND CONCAT(GREATEST(_fromDate, _toDate), " 23:59:59") 
	ORDER BY TransactionTime DESC LIMIT _numberOfRecords ;   	
	END */$$
