/* Procedure structure for procedure `mtxn_InsertTxnSummary` */

/*!50003 DROP PROCEDURE IF EXISTS  `mtxn_InsertTxnSummary` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `mtxn_InsertTxnSummary`(
    in p_MTI varchar(4),
    in p_transactionID varchar(12),
    in p_RRN varchar(12),
    IN p_GatewayRRN VARCHAR(12),
    IN p_GatewaySTAN  VARCHAR(6),
    in p_CustAadhaarNo varchar(12),
    in p_CustAccountNo varchar(20),
    in p_Amount varchar(13),
    in p_PostedTime timestamp(3),
    in p_TransactionTime timestamp(3),
    in p_GatewayResponseCode varchar(3),
    in p_IIN varchar(6),
    in p_OutletID varchar(30),
    in p_DeviceID varchar(60),
    in p_ResponseString varchar(512),
    in p_ClientIP varchar(24),
    in p_ClientPORT varchar(6),
    in p_GatewayConnectionTime timestamp(3),
    in p_GatewaySendTime timestamp(3),
    in p_GatewayRespBackTime timestamp(3),
    in p_MerchanID varchar(16),
    in p_BatchID varchar(16),
    IN p_Platform VARCHAR(15),
    in p_RespToClient varchar(3),
    in p_CBSTerminalID varchar(15),
    in p_VendorID varchar(3),
    in p_UUID varchar(60),
    in p_STAN varchar(6),
    in p_ServiceName varchar(15),
    in p_ServerTime timestamp(3),
    in p_TxnRemarks varchar(512),
    in p_Latitude varchar(15),
    in p_Longitude varchar(15))
BEGIN
    `CustAccountNumber`,`Amount`, `PostedTime`, `TransactionTime`, `GatewayResponseCode`,`IIN`, `OutletID`,`DeviceID`, `ResponseString`,
    `ClientIP`, `ClientPORT`, `GatewayConnectionTime`, `GatewaySendTime`, `GatewayRespBackTime`, `MerchantID`, `BatchID`,`Platform`, `RespToClient`
    ,`CBSTerminalID`, `VendorID`, `UUID`, `STAN`, `ServerTime`,`ServiceName`, `TxnRemarks`, `Latitude`, `Longitude`)
    values (p_MTI, p_transactionID, p_RRN, p_GatewayRRN,p_GatewaySTAN, p_CustAadhaarNo,
    p_CustAccountNo, p_Amount, p_PostedTime, p_TransactionTime, p_GatewayResponseCode, p_IIN, p_OutletID, p_DeviceID, p_ResponseString,
    p_ClientIP,  p_ClientPORT,  p_GatewayConnectionTime,  p_GatewaySendTime , p_GatewayRespBackTime,  p_MerchanID,  p_BatchID,
    p_Platform, p_RespToClient, p_CBSTerminalID, p_VendorID, p_UUID, p_STAN, p_ServerTime, p_ServiceName, 
    p_TxnRemarks, p_Latitude, p_Longitude);
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_GetPortalUserCredentials` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_GetPortalUserCredentials` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `sp_GetPortalUserCredentials`(inUserid BIGINT,inLevelid BIGINT,inHierarchyid BIGINT, inOverrideperm INT)
BEGIN
DECLARE _hierarchy_overrideperm INT;
SET _hierarchy_overrideperm=0;
	-- check overridepermission
	IF(inOverrideperm=1) THEN
		SELECT b.operationname, b.operationcode, b.scope,b.isactive FROM adm_useroperationdtl a
		INNER JOIN adm_operationmaster b ON a.operationid = b.operationid WHERE a.userid = inUserid;
	ELSE
	-- overridepermission=0 
		SELECT overridepermission INTO _hierarchy_overrideperm
		FROM adm_hierarchymaster  WHERE hierarchyid = inHierarchyid;
		
		IF(_hierarchy_overrideperm=1) THEN
			SELECT b.operationname, b.operationcode, b.scope,b.isactive FROM adm_hierarchyoperationdtl a 
			INNER JOIN adm_operationmaster b ON a.operationid = b.operationid WHERE a.hierarchyid = inHierarchyid;
		ELSE
			-- overridepermission=0 
			-- SELECT b.leveltype, b.levelcode, b.levelname FROM adm_leveloperationdtl a INNER JOIN adm_levelmaster b ON a.levelid = b.levelid;
			SELECT b.operationname, b.operationcode, b.scope,b.isactive FROM adm_leveloperationdtl a 
			INNER JOIN adm_operationmaster b ON a.operationid = b.operationid WHERE a.levelid = inLevelid;
		END IF;
		
		
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `txn_GetTxnReports` */

/*!50003 DROP PROCEDURE IF EXISTS  `txn_GetTxnReports` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `txn_GetTxnReports`(IN _outletID VARCHAR(10), IN _fromDate VARCHAR(10), _toDate VARCHAR(10) , _numberOfRecords INT(4))
BEGIN
	SELECT DATE_FORMAT(TransactionTime, '%m/%d/%Y') AS TransactionDate, TIME(TransactionTime) AS TransactionTime, TransactionID AS TransactionID, GatewayRRN AS RRN, Amount AS Amount, RespToClient AS RespToClient, ServiceName AS Service 
	FROM `mtxn_txnsummary` WHERE `OutletID`=_outletID AND TransactionTime BETWEEN CONCAT(LEAST(_fromDate, _toDate), " 00:00:00")
AND CONCAT(GREATEST(_fromDate, _toDate), " 23:59:59") 
	ORDER BY TransactionTime DESC LIMIT _numberOfRecords ;   	
	END */$$
DELIMITER ;

